import React from 'react';

const Menu = ({ menu }) => {
  return (
    <li>
      {menu.menu}  
      {menu.subMenus && menu.subMenus.length > 0 && (
        <ul>
          {menu.subMenus.map(subMenu => (
            <Menu key={subMenu.id} menu={subMenu} />
          ))}
          {menu.menu_item}
        </ul>
      )}
    </li>
  );
};
{menu.subMenus && menu.subMenus.length > 0 && (
  <ul className="dropdown-menu">
    {menu.subMenus.map((subMenu) => (
      <li key={subMenu.id}>
        <a className="dropdown-item" href={`/listing?categoryId=${subMenu.id}`}>
          {subMenu.menu}
        </a>
      </li>
    ))}
    {menu.menu_item && (
      <li className="dropdown-item">{menu.menu_item}</li>
    )}
  </ul>
)}
export default Menu;
